const Mainmentors = () => {
   const {t} =  useTranslation()
  return (

    <div>
    <MainHeader/>

        <div className='mentor_container'>  
            <h1 className='Mentor_title'>{t('be_cool')}</h1>

            <button></button>
             </div>
    </div>
  )
}

export default Mainmentors
